import React from 'react'

import classes from './Mapa.module.css';

function Mapa(props) {

    const arrayClasses=['classes', 'fill'];

    const rutas=props.routes.map((_,i)=>{
    return <div key={i} 
    className={classes.props.index === i ? arrayClasses.join(' '): classes.arrayClasses[0]}>
        {i+1}</div>
    })

    
    return (
        <div className={classes.Mapa}>
            {rutas}
            <div className={classes.line}></div>
        </div>
    )
}

export default Mapa;
